import React from 'react';
import gql from 'graphql-tag';
import { Mutation } from 'react-apollo';

const DeleteUserReview = gql`
mutation($_id: String!) {
	deleteReview(_id: $_id){
        message
  }
}
`;

const DeleteReview = ({id}) => {
  return (
    <div>delete{id}</div>
  )
}
export default DeleteReview;
